00214     public static void HandleWhereTokenContextualKeyword(CSharpParserModel model)
00215     {
00216         var whereTokenContextualKeyword = (KeywordContextualToken)model.TokenWalker.Consume();
00217         
00218         if (model.SyntaxStack.TryPeek(out var syntax) && syntax.SyntaxKind != SyntaxKind.TypeDefinitionNode)
00219             return;
00220         
00221         while (!model.TokenWalker.IsEof)
00222         {
00223             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken ||
00224                 model.TokenWalker.Current.SyntaxKind == SyntaxKind.StatementDelimiterToken)
00225             {
00226                 break;
00227             }
00228             
00229             _ = model.TokenWalker.Consume();
00230         }
00231     }
